import './App.style.scss';

const App = () => {

  const categories = [
    {
      id: 1,
      title: 'Hat',
    },
    {
      id: 2,
      title: 'Jacket',
    },
    {
      id: 3,
      title: 'Sneakers',
    },
    {
      id: 4,
      title: 'Womens',
    },
    {
      id: 5,
      title: 'Mens',
    },
  ]

  return (
    <div className='categories-container'>
      {categories.map((category) => {
        return (  
          <div className='category-container'>
            <div className='background-image' />
            <div className='category-body-container'>
              <h2>{category.title}</h2>
              <p>Shop Now</p>
            </div>
          </div>
        )
      })}

    </div>
  );
}

export default App;
